window.bookSummaryJSON = "<p><b>A secret baby and a second chance.&nbsp;</b></p> <p>From troubled teen to successful contractor,&nbsp;Jake Nichols is used to starting over. From childhood to his recent divorce, he’s a pro at making the best of things.&nbsp;</p> <p>Phoebe&nbsp;Ward thought she’d never see her first love again. Until a client meeting brings her face to face with the sexy man...who is the father of her&nbsp;child.&nbsp;</p> <p>After all these years, they finally have the opportunity to finish their story - if they can find their faith in a happy ending.&nbsp;</p> <p><b>This book was formerly called </b><b><i>Breathe</i></b><b>. No changes from original. </b></p>"; 
